// src/pages/BagPage.js
import React, { useState } from 'react';
import './style/search.css'; // Make sure to create a BagPage.css file for styling

const BagPage = () => {
  const [searchTerm, setSearchTerm] = useState('');

  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
  };

  const handleSearch = () => {
    // Implement search functionality or API call here
    console.log('Searching for:', searchTerm);
  };

  return (
    <div className="bag-search-page">
      <input
        type="text"
        value={searchTerm}
        onChange={handleSearchChange}
        placeholder="Search for bags..."
      />
      <button onClick={handleSearch}>Search</button>
      {/* Add components to render search results here */}
    </div>
  );
};

export default BagPage;
